import React from "react";
import ReactDOM from "react-dom";

class AboutUs extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-md-4"> </div>
        </div>
      </div>
    );
  }
}
export default AboutUs;
